'''
Вычислить 1000 значное число фибонначчи


'''
from math import sqrt, log

r1 = (1 + sqrt(5)) / 2  # ~=> 1.6180
r2 = (1 - sqrt(5)) / 2  # ~=> -0.6180
a = 1 / sqrt(5)  # ~=> 0.4472
b = -a  # ~=> -0.4472
n1 = (log(10 ** 1000 / a)) / log(r1)  # ~=> 4787.6
n = round(n1)  # ROUND UP #~=> 4787
thousandDigitFibonacci = a * r1 ** n + b * r2 ** n
thousandDigitFibonacci = int(thousandDigitFibonacci)  # ROUND DOWN
print("Generated answer: " + str(thousandDigitFibonacci))
print("Digits in answer: " + str(len(str(thousandDigitFibonacci))))


from decimal import *
getcontext().prec = 1500
r1 = (Decimal(1) + Decimal(5) ** Decimal(.5)) / Decimal(2)
r2 = (Decimal(1) - Decimal(5) ** Decimal(.5)) / Decimal(2)
a = Decimal(1) / Decimal(5) ** Decimal(.5)
b = -a
n1 = ((Decimal(10 ** 1000) / a).ln()) / r1.ln()
n = n1.quantize(Decimal('1.'), rounding=ROUND_HALF_DOWN)
thousandOneDigitFibonacci = a * r1 ** n + b * r2 ** n
thousandOneDigitFibonacci = thousandOneDigitFibonacci.quantize(Decimal('1.'), rounding=ROUND_HALF_DOWN)
print("Generated answer: " + str(thousandOneDigitFibonacci))
print("Digits in answer: " + str(len(str(thousandOneDigitFibonacci))))
